INSERT INTO PROPERTY_CHANGE (   ENTITY_NAME_TX ,
                                ENTITY_ID ,
                                USER_TX ,
                                ATTACHMENT_IN ,
                                CREATE_DT ,
                                AGENCY_ID ,
                                DETAILS_IN ,
                                FORMATTED_IN ,
                                LOCK_ID ,
                                PARENT_NAME_TX ,
                                PARENT_ID ,
                                TRANS_STATUS_CD ,
                                UTL_IN
                            )
            SELECT 'Allied.UniTrac.Loan' ,
                   LOAN.ID ,
                   'INC0323858' ,
                   'N' ,
                   '2017-10-20 00:00:00.000' ,
                   1 ,
                   'Y' ,
                   'N' ,
                   1 ,
                   'Allied.UniTrac.Loan' ,
                   LOAN.ID ,
                   'PEND' ,
                   'N'
            FROM   LOAN
            WHERE  ID IN (   SELECT ID
                             FROM   UniTracHDStorage.dbo.LOAN_1250_1
                         );
