--3) INSERT into PROPERTY_CHANGE_UPDATE table
INSERT INTO PROPERTY_CHANGE_UPDATE (   CHANGE_ID ,
                                       TABLE_NAME_TX ,
                                       TABLE_ID ,
                                       COLUMN_NM ,
                                       FROM_VALUE_TX ,
                                       TO_VALUE_TX ,
                                       DATATYPE_NO ,
                                       CREATE_DT ,
                                       DISPLAY_IN ,
                                       OPERATION_CD
                                   )
            SELECT PROPERTY_CHANGE.ID ,
                   'LOAN' ,
                   ENTITY_ID ,
                   'NUMBER_TX' ,
                   UniTracHDStorage.dbo.LOAN_1250_1.NUMBER_TX ,
                   LOAN.NUMBER_TX ,
                   1 ,
                   '2017-10-20 00:00:00.000' ,
                   'Y' ,
                   'U'
            FROM   PROPERTY_CHANGE
                   INNER JOIN LOAN ON PROPERTY_CHANGE.ENTITY_ID = LOAN.ID
                                      AND ENTITY_NAME_TX = 'Allied.UniTrac.Loan'
                   INNER JOIN UniTracHDStorage.dbo.LOAN_1250_1 ON LOAN.ID = UniTracHDStorage.dbo.LOAN_1250_1.ID --AND ENTITY_NAME_TX = 'Allied.UniTrac.Loan' 
            WHERE  PROPERTY_CHANGE.CREATE_DT = '2017-10-20 00:00:00.000'
                   AND ENTITY_ID IN (   SELECT ID
                                        FROM   UniTracHDStorage.dbo.LOAN_1250_1
                                    );
